  \"2016-11-18T21:03:26.323066\",\n\t\"name\": \"lesotho-health-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \" n        The main objective of the 2011
  Health Facility Survey (HFS) was to establish a baseline for informing the Health
  Project performance indicators on health facilities, in line with the approved MCA-Lesotho
  Monitoring and Evaluation Plan and Health Project Activity Monitoring Plan. The
  specific objectives of the survey were to: n- Document basic characteristics of
  health facilities and staffing patterns; n- Assess the condition of infrastructure
  and availability and reliability of basic utilities (water, electricity, telephone)
  for supporting provision of quality essential health services; n- Assess the availability
  of drugs, equipment, supplies and essential health services in line with Essential
  Health Services List of the Ministry of Health and Social Welfare (MOHSW); n- Assess
  quality of services and trends in service utilization; and n- Assess the level of
  compliance with health care management and infection prevention and control standards.n
